import React from 'react';
import s from './Achievemtns.module.css';
import AchievemtnsCart from './AchievemtnsCart';

const Achievements = (props) => {

    let carts = 
    props.carts.map(() => <AchievemtnsCart />)

    debugger;
    return (
        <div className={s.body}>
            <span id={s.header}>Achieventns And Certifications üèÜ</span>
            <span id={s.description}>ACHIEVEMENTS, CERTIFICATIONS, AWARD LETTERS AND SOME COOL STUFF THAT I HAVE DONE !</span>


            <div className={s.cart}>
                <img id={s.achieventn_img2} src="https://developerfolio.js.org/static/media/googleAssistantLogo.e79c6392.webp" alt="" />
                <span id={s.achievemt_header}>Google Assistant Action</span>
                <span id={s.achievemt_description}>Lorem ipsum dolor sit amet consectetur adipisicing elit. Expedita excepturi nobis, provident beatae sit nesciunt.</span>
                <div className={s.buttons}>
                    <button>View Google Assistant Actionbutton</button>

                </div>
            </div>

            <div className={s.cart}>
                <img id={s.achieventn_img3} src="https://developerfolio.js.org/static/media/pwaLogo.ee62cb58.webp" alt="" />
                <span id={s.achievemt_header}>PWA Web App Developer</span>
                <span id={s.achievemt_description}>Lorem ipsum dolor sit amet consectetur adipisicing elit. Expedita excepturi nobis, provident beatae sit nesciunt.</span>
                <div className={s.buttons}>
                    <button>View Google Assistant Actionnbutton</button>
                </div>
            </div>
        </div>
    );
}

export default Achievements;
